cm706118s000mjp03am3rkzml	Scala2 Polytank 70 Gallon Coffin Tank & 210L Indirect Cylinder (94835)	The Grundfos SCALA2 is a fully integrated, self-priming, compact waterworks for pressure boosting in domestic applications. SCALA2 incorporates integrated speed control enabling the keeping of the perfect pressure at the taps, meaning that the pump performance will increase with increasing demand.\n\nThe SCALA2 can be installed in three easy steps:\n\nConnect the pipes.\nPrime the pump.\nPlug the pump into the power outlet and the pump will start.\nPlease Note - This pump cannot be fitted directly to the water mains. A minimum of 1" suction pipe is required.\n\nAs it is self-priming, the SCALA2 is able to pump water from a level below the pump. Provided it is filled with water, the pump is able to lift water from a depth of 8 m in less than 5 minutes. This facilitates easy installation and start-up of the pump and provides more reliable water supply in installations where there is a risk of dry running and leakages in suction hose or pipes.\n\nIf exposed to dry running, water shortage or excessive temperature, blocked pump, for example in case of seizure or overload, the pump will stop automatically, thus preventing a motor burnout. Thanks to its hydraulic design, permanent magnet motor and water cooling, the pump is extremely low-noise, 47 dB(A) in typical use, which makes it suitable for indoor as well as outdoor use. Max. Noise level at full load are 53 dB(A)\n\nSCALA2 require no maintainance, but it is recommended to keep the pump clean, check the non-return valves and keep the ventilation holes free of dust.\n\n\nPolyTank 70 Gallon Coffin Tank\n\nThe Polytank 70 Gallon Coffin Tank (model 64-24-19) is a rectangular cold water storage tank designed for loft installations. It has a capacity of 318 liters (70 gallons) and dimensions of 1650mm (64 inches) in length, 610mm (24 inches) in width, and 500mm (19 inches) in height.\n\nThis tank is WRAS approved and kitemarked to BS4213:2004, ensuring compliance with UK water regulations.\n\nKit Includes:\n\n1 x Coffin Tank\n1 x Tank Jacket\n1 x Screened Warning Pipe Elbow\n1 x Vent Pipe Sleeve\n1 x Screened Breather\n1 x Dip Tube\n1 x Ballvalve Backplate\n1 x 1/2" Part 2 Ballvalve and Float\n1 x 22mm Compression Tank Connector\n1 x 15mm Chrome Bent Service Valve\nIdeal Heating Pro 210L Indirect Unvented Cylinder\n\nThe Ideal Pro 210 L Indirect Unvented Cylinder is a type of hot water storage tank designed for use in homes or businesses that require a reliable and efficient hot water supply. Here's a breakdown of its features and specifications:\n\nKey Features:\n\nIndirect Heating: The "indirect" part means that the cylinder heats water via a separate heat source, such as a boiler, instead of using direct electrical heating elements. The boiler heats water, which is then circulated through a coil or plate heat exchanger inside the cylinder to heat the stored water.\nUnvented: Being "unvented" means that the cylinder is pressurized. It does not rely on gravity or a cold water tank in the loft. The system works at mains pressure, delivering strong water flow to taps and showers.\nSize and Capacity (210L): This cylinder has a storage capacity of 210 liters, making it suitable for medium to large homes or businesses. It can provide hot water to multiple outlets simultaneously without a loss in pressure.\nEfficiency: The Ideal Pro Indirect Unvented Cylinder is designed with thermal insulation to minimize heat loss, ensuring efficient energy use and reducing heating costs.\nDurability: These cylinders are typically made with high-quality materials, ensuring long-lasting performance with proper maintenance.\nSafety Features: It often includes safety mechanisms like pressure relief valves, which are important for maintaining the safe operation of the unvented system.\nBenefits:\n\nBetter Water Pressure: Since the system operates on mains pressure, you can enjoy strong water pressure from taps and showers.\nEnergy Efficiency: Indirect cylinders are energy efficient since they use a boiler to heat the water, which can be more cost-effective than electrical heating.\nMore Hot Water: The 210-liter capacity means there’s more hot water available for simultaneous use.\nNo Need for a Cold Water Tank: As it’s unvented, there’s no need for an additional cold water storage tank in the attic or loft, which can save space.\nIdeal For:\n\nHomes with multiple bathrooms or high water demand.\nProperties with an existing central heating system, particularly a boiler.\nThose who want an efficient, pressurized hot water system without the need for an additional cold water tank.\nThe Ideal Pro 210 L Indirect Unvented Cylinder is a solid choice for those looking for a high-performance hot water system that delivers ample hot water with strong pressure, while also being energy-efficient and reliable.\n\nComponents supplied with Ideal Pro:\n\nCold water inlet PRV combination valve/expansion relief\nPressure and temperature relief valve\nControl thermostat\nEnergy cut-out thermostt\nEnergy cut-out motorised valve (indirects only)\nTundish\n1x 3kW Immersion heater including control and cut out thermostats\nExpansion vessel complete with mounting bracket	Polytank	Home Booster Pump			\N	\N	\N		\N		\N	\N	\N		cm47ej9lz0001mn03bm9lfcui	\N	\N	\N	cm704wjca0000js03kjmfnsdr	ACTIVE	{}	2025-02-11 07:33:32.428	2025-02-11 07:33:32.69	{"Perfect water pressure: Intelligent pump control adjusts operation automatically","Low noise: As quiet as a modern dishwasher (47 dB(A) in typical use)","Easy selection: One variant for all domestic boosting needs","Easy installation: Compact, all-in-one solution, plug-and-pump","Easy to operate: User-friendly control panel","Reliable operation: Dry-running protection, anti-cycling","Long lifetime: Quality-tested to perfection, maintenance-free"}	{https://files.edgestore.dev/pxv725c20ifyorev/publicImages/_public/product/732293c6-c7a6-44c5-838f-34f0eac86baa.jpg}